Local synonymy:
Chiloscyllium punctatum
— Filewood, 1973 : 8 ( PNG ); Kailola, 1987 : 7 (Daru, Yule Island, Orokolo Bay , Gulf of Papua and New Guinea coast); Allen, 1998 : 67 ( Milne Bay ); Compagno, 2001 : 176 ( PNG );
Allen et al. , 2003
: 112 ( Milne Bay ); Last & Stevens, 2009: 147 (New Guinea );
Fricke et al ., 2014
: 13 ( Madang );
White et al. , 2018
: 70, figs ( PNG ).

Remarks: First recorded from PNG by Filewood (1973) , but listed as not common. Abundant in the prawn trawl grounds of the Gulf of Papua . Recently photographed during fish surveys off Madang (
Fricke et al. , 2014
) and in coastal fisheries catches off Wewak (trap fishery).
